import React from 'react';
import { PlusOutlined } from '@ant-design/icons';
const Room = () => {

    return (
        <div>

        <div className="messageTitle" style={{borderBottom: "solid thin #EFEEF5", display:"flex", justifyContent:"center", alignItems:"center"}}>
            <div style={{display: "flex"}}>
                <h2 style={{float:"left"}}>&nbsp;&nbsp;Messages</h2>
                <PlusOutlined />
            </div>
        </div>

        <div style={{clear:"both"}}>
        <h1>Send a message, get a message</h1>
        <p>Direct Messages are private conversations between you and other people on Twitter. Share Tweets, media, and more!</p>
        </div>

        </div>
    );
}

export default Room;
